import React from 'react';
import './styles.css';

export interface Profile {
  name: string;
  login: string;
  bio: string;
  company: string;
  twitter_username: string;
  blog: string;
  location: string;
  public_repos: number;
  followers: number;
  link: string;
  avatar_url: string;
}

interface ProfileProps {
  profile: Profile;
}

const GitHubProfile: React.FC<ProfileProps> = ({ profile }) => {
  return (
    <div id="profile-item">
      <div className="profile-top">
        <img src={profile.avatar_url} alt="Logo"/>
      </div>
      <div className="profile-down">

      </div>
    </div>
  )
}

export default GitHubProfile;
